import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import Contact from '../pages/Contact';

const NaContainer = styled.Na`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 1rem 2rem;
  background-color: #6c63ff;
  color: white;
`;

const NaLinks = styled.div`
  display: flex;
  gap: 1.5rem;
`;

const NaLink = styled(Link)`
  color: white;
  text-decoration: none;
  font-weight: bold;
  &:hover {
    color: #f0f0f0;
  }
`;

const NaBar = () => {
  return (
    <NaContainer>
      <h1>My Blog</h1>
      <NaLinks>
        <NaLink to="/">Home</NaLink>
        <NaLink to="/blogs">Blogs</NaLink>
        <NaLink to="/about">About</NaLink>
        <NaLink to="/contact">Contact</NaLink>
        <NaLink to="/login">Sign In</NaLink>
        <NaLink to="/register">Register</NaLink>
      </NaLinks>
    </NaContainer>
  );
};

export default NaBar;
